import React from "react";
import { Link } from "react-router-dom";

const Card = ({ work }) => {
    const { title, tags, year, thumb, color, slug } = work;

    return (
        <Link to={'/work/' + slug} className='thumb'>

            <div className='thumb-image' style={{background: color[1]}}>
                <img src={thumb} />
            </div>
        </Link>
    );
};

export default Card;
